export const MvAssistant = () => {
  return (
    <>
      <section className="mv-assistant-layout">
          <div className="assistant-form">
            <div className="assist-logo"></div>
            <div className="assist-header"></div>
            <div className="assist-bt">LEARN MORE</div>
          </div>
      </section>
    </>
  );
};
